const GameOver = (props) => {
    const newGame = props.newGame;

    return (
        <div id="gameOver">
            <h1 id="gameOverTitle">Game Over</h1>
            <button id="neGame" onClick={newGame}>New Game</button>
        </div>
    )
}

export default GameOver;
